import React,{useStare} from "react";


function Card({info}){


    return(
<div>
    <img src="bmw.jpg"></img>
    <ul>
        <li>{info.marka}</li>
        <li>{info.model}</li>
        <li>{info.year}</li>
        <li>{info.information}</li>
    </ul>
</div>
    )

}
export default Card
